import React from 'react'
import './Offers.css'

const Offers = () => {
  return (
    <div className='offers'>
       <div className='offers-left'>
           <h1>Exclusive</h1>
           <h1>Offers</h1>
       </div>
    </div>
  )
}

export default Offers
